     articalname={ListArray[4].arcticalname}
     des = {ListArray[4].des}
     name={ListArray[4].name}

     />
       <Card   
     /*technics ={faker.image.technics()}
     articalname = {faker.commerce.productName()   }
     des ={faker.commerce.productDescription()}
     name = {faker.name.fullName() }*/
     technics = {ListArray[5].technics}
     articalname={ListArray[5].arcticalname}
     des = {ListArray[5].des}
     name={ListArray[5].name}

     />



   
  



     </div>

    )

}

export default Cardlist
